import { Injectable } from '@angular/core';
import {Observable} from "rxjs";
import {AuthenticationRequest, AuthenticationResponse, AuthenticationService} from "../../../journal-api/src";

@Injectable({
  providedIn: 'root'
})
export class UserService {

    constructor(private authenticationService:AuthenticationService , private http
    ) {
    }

    login(authenticationRequest:AuthenticationRequest):Observable<AuthenticationResponse>{

        return this.authenticationService.authenticate(authenticationRequest) ;
    }

  setAccessToken(authenticationResponse: AuthenticationResponse): void {
    localStorage.setItem('accessToken', JSON.stringify(authenticationResponse));
    console.log(localStorage.getItem('accessToken')) ;

  }

}
